export const Rockets = ({ rocket }: { rocket: any }) => {
  return (
    <div key={rocket.id}>
      <div>
        <p>{rocket.name}</p>
      </div>
        <p>Description:</p>
        <p>{rocket.description}</p>
    </div>
  )
}
